import React, { useEffect, useState } from 'react';
import './App.css';

import scale from './assets/radaltback.png';
import cover from './assets/radaltcover.png';
import needle from './assets/radaltneedle.png';
import bugImg from './assets/bug.png';
import flagImg from './assets/radaltflag.png';

function App() {

  return (
    <div>      
      <div className='core'>
        <div className='title'>
          <h1>Radar Altimeter</h1>
        </div>
        <div className='radalt-image'>
          <img className='radaltback' src={scale}></img>
          <img className='radaltcover' src={cover}></img>
          <img className='radalneedle' src={needle}></img>
          <img className='bug-ponter' src={bugImg}></img>
          <img className='radaltflag' src={flagImg}></img>
        </div>       
      </div>
      <div className='range-input'>
        <div className='altitude'>
          <h4>Altitude: </h4>
          <input type='range'></input>
          <p className='altitude-range-number'>1500</p>
        </div>
        <div className='bug'>
          <h4>Bug: </h4>
          <input type='range'></input>
          <p className='bug-range-number'>1500</p>
        </div>
        <div className='haspower'>
          <h4>Has power</h4>
          <input type='checkbox'></input>
        </div>

      </div>

    </div>
  );
}

export default App;
